// ==UserScript==
// @name        Tomato Alarm
// @name:ja     トマトアラーム
// @description In the manner of the Pomodoro Technique, an alarm (the sound of a wind chime) is sounded once every 10 minutes after the start button is pressed.
// @match       *://*/*
// @author      hidao80
// @version     1.2.3
// @namespace   https://github.com/hidao80/UserScript
// @license     MIT
// @icon        https://cdn.jsdelivr.net/gh/twitter/twemoji@14.0.2/assets/72x72/1f345.png
// @run-at      document-end
// @grant       none
// @updateURL   https://github.com/hidao80/UserScript/raw/main/TomatoAlarm/TomatoAlarm.user.js
// @downloadURL https://github.com/hidao80/UserScript/raw/main/TomatoAlarm/TomatoAlarm.min.user.js
// ==/UserScript==
const button=document.createElement("div");button.textContent="🍅Start🍅";button.style.cssText=`\n    position: fixed;\n    right: 10px;\n    bottom: 10px;\n    font-size: 1.2rem;\n    line-height: 1.2rem;\n    background: #fff;\n    color: #737373;\n    padding: 10px;\n    border: solid 1px;\n    border-radius: 50%;\n    box-shadow: 0 2px 10px -6px rgba(0,0,0,.5), 0 3px 10px -4px rgba(0,0,0,.2);\n    z-index: 10000;\n`;document.body.appendChild(button);let beep=null;button.onclick=A=>{const V="";beep=new Audio("data:audio/mp3;base64,"+V);button.style.display="none";setInterval((A=>{beep?.play()}),6e5)};
